import React from "react";

import styles from "../CSS/component.module.css";

export const EstimateUnfinished = ({ taskName, taskType, submitter, turn }) => {
  const Estimate = () => {
    <p style={{ zIndex: 999 }}>HELLO WORLD</p>;
  };
  return (
    <div className={styles.outer_row_unfinished}>
      <div className={styles.inner_row_unfinished}>
        <p>{taskName}</p>
        <p>{taskType}</p>
        <p>{submitter}</p>
        <p>{turn}</p>
        <button onClick={() => Estimate()}>평가하기</button>
      </div>
    </div>
  );
};
